body {
  font-family: 'Open Sans', sans-serif;
  padding: 0;
  margin: 0;
}

h3 {
  margin: 0 0 10px 0;
}

.game {
  display: grid;
  grid-template-areas: 'board board players logs' 'board board players video' 'board board players video' 'board board players video';

  grid-template-columns: repeat(2, calc(@boardWidth / 2)) repeat(2, 1fr);
  grid-template-rows: repeat(4, calc(@boardWidth / 4));

}

.game-loading {
  display: flex;
  align-items: center;
  justify-content: center;
  height: 100vh;
}

.card-overlay {
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background-color: rgba(0, 0, 0, 0.5);
  z-index: 999;

  .card-picked {
    position: absolute;
    top: 200px;
    left: calc(50% - 250px);
    width: 500px;
    min-height: 250px;

    border: 2px solid black;
    padding: 20px;


    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;

    span {
      display: block;
      padding: 10px;
    }

    &.chance {
      background-color: #ffa500;
    }

    &.community {
      background-color: #4987ff;
    }

    .close {
      position: absolute;
      font-size: 20px;
      top: 15px;
      right: 15px;
      cursor: pointer;
    }

    .card-type, .card-player {
      font-size: 25px;
      font-weight: bold;
    }


    .card-text {
      flex-grow: 2;
      font-size: 30px;
    }
  }
}

.video-chat {

  .video-container {
    display: grid;
    grid-template-columns: 50% 50%;

    video {
      background-color: black;
      margin: 1px;
      cursor: pointer;
      transition: all 0.25s;
      width: 100%;
      height: 150px;

      //&:hover {
      //  width: 100%;
      //  height: auto;
      //}
    }
  }

  .chat {
    height: 150px;
    overflow-y: auto;

    p {
      margin: 0;
      font-size: 14px;
    }
  }
}

.logs {
  grid-area: logs;

  .text {
    height: 150px;
    overflow-y: auto;

    p {
      margin: 0;
      font-size: 14px;
    }
  }
}


.player-list {
  grid-area: players;
  width: 400px;
}

.video-chat {
  grid-area: video;
}

.me {
  h1 {
    margin: 10px 0 0 0;
    font-size: 20px;
  }
}

.card-stack {
  position: absolute;
  width: @cardStackWidth;
  height: @cardStackHeight;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  border: 1px solid black;
  top: 550px;
  cursor: pointer;

  &.chance-stack {
    left: 200px;
    background-color: #ffa500;
  }

  &.community-stack {
    left: 500px;
    background-color: #4987ff;
  }
}

.board-container {
  grid-area: board;
  position: relative;

  .dice-set {
    cursor: pointer;
    position: absolute;
    top: 200px;
    left: 300px;
  }

  .board-token {
    position: absolute;
    z-index: 20;
  }

}

